Вы можете вывести из кошелька сумму последнего пополнения — тогда деньги вернутся вам в течение 5 рабочих дней. Вот несколько условий: 

— пополняли с карты, через СБП или T‑Pay;
— прошло меньше 30 дней;
— вся сумма есть на балансе. 

Нужно в истории операций нажать на строку со значком «Можно вернуть» и оформить возврат.
